/// 11. Container With Most Water
ires = WaterContainer.MaxArea(new int[] { 1, 8, 6, 2, 5, 4, 8, 3, 7 });
Debug.Assert(ires == 49, WRONG);

ires = WaterContainer.MaxArea(new int[] { 1, 1 });
