/// 20. Valid Parentheses

bres = ValidParentheses.IsValid("({[({})]})");
Debug.Assert(bres, WRONG);

bres = ValidParentheses.IsValid("()");
Debug.Assert(bres, WRONG);

bres = ValidParentheses.IsValid("{}");
Debug.Assert(bres, WRONG);

bres = ValidParentheses.IsValid("[]");
Debug.Assert(bres, WRONG);

bres = ValidParentheses.IsValid("(){}[]");
Debug.Assert(bres, WRONG);

bres = ValidParentheses.IsValid("({[{}]})");
Debug.Assert(bres, WRONG);

bres = ValidParentheses.IsValid("(()");
Debug.Assert(!bres, WRONG);

bres = ValidParentheses.IsValid("(])");
Debug.Assert(!bres, WRONG);


